import React from 'react';
import { Link } from 'react-router-dom';
import { TopNavStyle } from "./style";


const TopNav = () => {
  return (
    <TopNavStyle>
      <ul>
      <Link to = "/"><h1 style={{ fontFamily: "Noto Sans KR", fontWeight: "bold", color: "white" }}>UOS GOODS</h1></Link>

      <Link to="/jacket" style={{ fontFamily: "Noto Sans KR", fontWeight: "bold", color: "white" }}>  과잠  </Link>
      <Link to="/goods" style={{ fontFamily: "Noto Sans KR", fontWeight: "bold", color: "white" }}>  굿즈  </Link>
      <Link to="/menu1" style={{ fontFamily: "Noto Sans KR", fontWeight: "bold", color: "white" }}>  메뉴1  </Link>
      <Link to="/menu2" style={{ fontFamily: "Noto Sans KR", fontWeight: "bold", color: "white" }}>  메뉴2  </Link>
      </ul>
    </TopNavStyle>
  );
};

export default TopNav;
